import React from "react";

function StoresTable() {
  return (
    <>
      <table>
        <thread>
          <tr>
            <th>city</th>
            <th>state</th>
            <th>zip code</th>
          </tr>
        </thread>
      </table>
    </>
  );
}

export default StoresTable;
